import "./Display.css"
import { useState, useEffect } from "react";


function ProductsList({children}) {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    items()
  }, [])

  // Fetched items
  const items = async () => {
    const res = await fetch(`https://fakestoreapi.com/products/2`)
    const data = await res.json()

    setProducts(data)
  } 

  return (
    <div>
      <div className="box">
        <p>
          {products.id}
          {products.titl }
          {products.description }
        <img src={`${products.map(products => products.image) }`} alt="" className="img" />
        </p>
        {children}
      </div>
    </div>
  )
}

export default ProductsList
